import React, { Component } from 'react';
import Axios from 'axios';

class ScheduleTime extends Component {

    constructor(props) {
        super(props);

        this.state = {
            schTime : '',
        }

      }


    componentDidMount() {


    Axios.get(`https://kido-bookt-backend-default-rtdb.firebaseio.com/groupContents/${this.props.groupId}/scheduleDate/${this.props.scheduleDateId}/scheduleTime.json`)
    .then((response) => {
           console.log(response);
        this.setState({
            schTime: response.data
        })
    })
        .catch((error) => console.log(error));

    }

    render() {
        return (


             <div className="timeslotdiv">
                 {Object.entries(this.schTime).map((item) => (
                <>
                <input type="radio" required="" className="timeslotinput" name="schedule_time" id="timdateslot1" value="10:30" data-time="10:30 AM"/>
                 <label htmlFor="timdateslot1">{item[1].timeSlot}</label>
                </>
                )
            )}
            </div>


        )}

}

export default ScheduleTime;
